import Story from './components/story';
import HomeCategory from './components/home_category';

function App() {
  return (
    <div className="App">
        <Header />
        <div className={'main'}>
            <div class={'container'}>
                <Story />
                <div className={'row'}>
                    <div className={'col-lg-9 col-md-9 col-12'}>
                        <HomeCategory />
                    </div>
                    <div className={'col-lg-3 col-md-3 col-12'}>
                        <div className={'bannerList'}>

                        </div>
                    </div>
                </div>
            </div>
        </div>
    </div>
  );
}

export default App;
